import React from 'react';

export const SideBar = () => {
    return(
        <div className="sidebar" data-test-id="sidebar">
            <ul className="sidebar_generic">
                <li>Inbox</li>
                <li> Today</li>
                <li> Next 7 days!!</li>
            </ul>
        </div>
    );
}
